  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this project was to obtain
  data that are pertinent to assessing aspects of the distribution and foraging ecology
  of pinnipeds inhabiting the California Current.  The California Current Ecosystem
  Program has attached satellite instruments and/or archival time-depth recorders
  on pinnipeds inhabiting waters off Washington, Oregon, and California to examine
  their haulout and at-sea spatial distribution, diving behaviors, and movement patterns
  at varying temporal scales.  We aim to integrate telemetry data with aspects of
  their physiology and diet to assess sex/age-related differences by conspecifics
  or intra-specific differences among seals, sea lions, or fur seals in the California
  Current. Locations are calculated and provided by the Argos satellite system (http://www.argos-system.org/).
  Additional software are required to decode these data. Data are, generally, in the
  same format as originally delivered from Argos/CLS America and no quality assurance
  or quality control measures have been implemented.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
